import React, { Component } from 'react'
import { movies } from './getmovies'

export default class Faviourates extends Component {
    constructor(){
        super();
        this.state={
            genres:[],
            currgen:'All Genres',
            movies:[]
        }
    }

    componentDidMount(){
        let genreids = { 28: 'Action', 12: 'Adventure', 16: 'Animation', 35: 'Comedy', 80: 'Crime', 99: 'Documentary',  18: 'Drama', 10751: 'Family', 14: 'Fantasy', 36: 'History', 27: 'Horror', 10402: 'Music', 9648: 'Mystery', 10749: 'Romance', 878: 'Sci-fi', 10770: 'TV', 53: 'Thriller', 10752: 'War', 37: 'Western' };
        let data = JSON.parse(localStorage.getItem("movies-app")||"[]")
        let temp=[];
        data.forEach((movieobj)=>{
           if(!temp.includes(genreids[movieobj.genre_ids[0]])){
           temp.push(genreids[movieobj.genre_ids[0]]);
            }
        })
        temp.unshift('All Genres');
        this.setState({
            genres:[...temp],
            movies:[...data]
        })
        
    }

  render() {
        // const movie = movies.results ;
        // console.log(movie);
    
    
    
    
    // this.setState({
    //     genres:[...temp]
    // })

   console.log(temp);

    return (
     <div>
        <>
        <div className="main">
               <div className="row">
                  <div className="col-3">
                      <ul class="list-group favourites-genres">
                        {
                            this.state.genres.map((genre)=>(
                                this.state.currgen === genre ?
                                <li class="list-group-item" style={{background:'#3f51b5', color:'white', fontWeight:'bold'}}>{genre}</li>:
                                <li class="list-group-item" style={{background:'white', color:'#3f51b5', fontWeight:'bold'}}>{genre}</li>
                            ))
                        }
    
                      </ul>
                  </div>
                  <div className="col-9 favourites-table">
                        <div className="row ">
                            <input type="text" className="input-group-text col" placeholder='Search'></input>
                            <input type="number" className="input-group-text col" placeholder='Rows Count'></input>
                        </div>
                        <div className="row">
                            <table class ="table">
                                <thead>
                                    <tr>
                                        <th scope="col">Title</th>
                                        <th scope="col">Genre</th>
                                        <th scope="col">Popularity</th>
                                        <th scope="col">Rating</th>
                                    </tr>
                                </thead>
                                <tbody>

                                    {
                                        this.state.movies.map((movieobj)=>(
                                            <tr>
                                            <td><img src={`https://image.tmdb.org/t/p/original${movieobj.backdrop_path}`} alt={`${movieobj.original_title}`} style={{width:'4rem', height:'4rem', padding:'0.2rem'}}></img>{ movieobj.original_title}</td>
                                            <td>{genreids[movieobj.genre_ids[0]]}</td>
                                            <td>{movieobj.popularity}</td>
                                            <td>{movieobj.vote_average}</td>
                                            <td><button type="button" class="btn btn-danger">Delete</button></td>
                                            </tr>
                                        ))
                                    }
                                    
                                </tbody>
                            </table>
                        </div>

                        <nav aria-label="Page navigation example">
                            <ul class="pagination">
                                <li class="page-item"><a class="page-link" href="#">Previous</a></li>
                                <li class="page-item"><a class="page-link" href="#">1</a></li>
                                <li class="page-item"><a class="page-link" href="#">2</a></li>
                                <li class="page-item"><a class="page-link" href="#">3</a></li>
                                <li class="page-item"><a class="page-link" href="#">Next</a></li>
                            </ul>
                        </nav>
                        

                        
                  </div>
               </div>
        </div>
        </>
     </div>
    )
  }
}
